import { Link } from "react-router-dom";

export default function ProductCard(props) {

  const { productData, handleNavigate } = props;

  return (

    <div className="card h-100 position-relative">
      <div>
      {productData.stock == 0 ? (
          <span class="badge text-bg-danger position-absolute m-5">Out of stock</span>
        ) : (
          <span class="badge text-bg-success position-absolute m-5">In stock</span>
        )}
      </div>
      <img src={productData.thumbnail} className="card-img-top" alt="..." />
      <div className="card-body">
        <div className="row">
          <p className="card-title col">{productData.title}</p>
          <div className="col position-relative">
            <span className=" position-absolute end-0">{productData.price} $ </span>
          </div>   
        </div>
        
        <p className="card-text">{productData.description}</p>
        {/* {productData.tags.map((tag) => (
          <span className="badge text-bg-primary">{tag}</span>
        ))} */}
         <button
          className="d-block mt-3 btn btn-success"
          onClick={() => handleNavigate(productData.id)}
        >
          Add to cart
        </button>
      </div>
    </div>
  );
}
